import { useEffect, useState } from "react";

const GetAPIData = () => {
    
    const [pokemonEndpoint, setPokemonEndpoint] = useState([]);
    
    useEffect(() => {
        getEndpoints();
    }, [])
    
    const getEndpoints = async () => {
        try {
            const endpointsPokemons = [];
            
            for (let i = 1; i <= 6; i++) {
                endpointsPokemons.push(`https://pokeapi.co/api/v2/pokemon/${i}`);
            }

            console.log(endpointsPokemons);

        } catch (error) {
            console.log('An erroroccured:', error);
        }

  };
}

export default GetAPIData;
